  - name: TEXT4000
    number: '6'
    value: 'The employees reported on H4 do not spend more than 25% of their time
      on federal election activity and therefore are not subject to 11 CFR 300.33(c)(2).    The
      committee does not use any national party transfers to fund Federal Election
      Activity.  The party utilizes a strict accounting method to ensure that national
      party transfers are being used only for permissible administrative and overhead
      expenses.  This accounting method also guarantees that all Federal Election
      Activity is being funded by contributions raised under the limitations and prohibitions
      of the Federal Election Campaign Act, as amended.    The committee maintains
      a separate Levin account which was established solely for the receipt of Levin
      funds for Federal Election Activity according to 11 CFR 300.30.    The payments
      to individuals for office cleaning and computer consulting reported on H4 are
      not employees of the committee and therefore are not subject to 11 CFR 300.33(c)(2).    The
      phrase Voter registration table in the purpose field on H6 is generic in nature
      and does not reference any federal candidate or any other Federal Election Activity.  The
      individuals who maintain these tables are not employees of the committee and
      therefore not subject to 11 CFR 300.33(c)(2).    The check from the Victory
      Darren White Fund JFC is the final distribution of the residual funds.  All
      Donors have previously been itemized.    To clarify the Refund/Rebates on Schedule
      A, line 15, the amount from John McCain 2008, Inc. is for reimbursement of rent
      for shared office space with Victory 2008. The disbursement for rent was made
      11-1-08 to Vista Balloon Commons Operating Association, LP.    No disbursements
      on Line 21b and/or Line 30b were made on behalf of or against a clearly identified
      candidate for Federal office unless specifically noted.    To clarify the reimbursement
      for electronic fax service, this was solely an internet service used in the
      office in lieu of purchasing a fax machine.    To clarify the transfers to the
      Non-federal account, the funds reported on Schedule B supporting line 22 were
      not in any way used in connection with any federal election, or any federal
      candidate, or any activities that qualify as Federal Election Activity.  Rather,
      these transferred funds were utilized solely in connection with state and non-federal
      candidates and activities.    To clarify the payment for Voter registration
      table on Schedule H4, the only disbursement for voter registration table using
      funds allocated between Federal and Non-federal was made on 11-20-08 which is
      16 days past the general election date and, therefore, not considered to be
      Federal Election Activity.  This activity was strictly generic voter registration.  '
